INSERT INTO `h_carousel` (`id_carousel`, `include_logo`, `judul`, `paragraf`, `image`, `posisi`) VALUES
(19, 1, 'Himpunan Mahasiswa Prodi Teknik Informatika Universitas Duta Bangsa Surakarta', 'Bergerak untuk memajukan sumber daya manusia indonesia dalam mengasah skill di bidang teknologi.', '1631487954.jpg', 'middle');
INSERT INTO `h_detail_organisasi` (`id`, `nama_organisasi`, `tentang_kami`, `visi`, `misi`, `navbar_bg`, `navbar_text`, `image`, `daftar`) VALUES
(1, 'HMPTI UDB', 'Himpunan Mahasiswa Prodi Teknik Informatika (HMPTI) Fakultas Ilmu Komputer Universitas Duta Bangsa Surakarta yang bertempat di Kota Surakarta Provinsi Jawa Tengah.', 'Menjadikan Himpunan Mahasiswa Program Studi Teknik Informatika (HMPTI) sebagai himpunan mahasiswa yang berkualitas, unggul, serta aktif berperan meningkatkan kualitas pendidikan mahasiswa Teknik Informatika dengan menyalurkan potensi mahasiswa Teknik Informatika dalam bidang akademik.', '1. Menyesuaikan keadaan organisasi sehingga mampu selaras dengan kondisi mahasiswa Teknik Informatika.\r\n2. Menjalankan kegiatan sesuai dengan program kerja yang ada untuk menyalurkan aspirasi mahasiswa serta menampung kreativitas mahasiswa/i dalam bidang teknologi informatika.\r\n3. Memberi wadah bagi mahasiswa/i Teknik Informatika yang memiliki potensi dalam suatu bidang.\r\n4. Mengembangkan kemampuan mahasiswa Teknik Informatika untuk memiliki jiwa wirausaha dengan memanfaatkan teknologi yang ada.\r\n5. Menjalin komunikasi yang baik dantara pengurus agar tercipta suasana kekeluargaan yang harmonis.\r\n6. Memepererat relasi mahasiswa Teknik Informatika baik relasi internal antara mahasiswa/i Teknik Informatika maupun relasi eksternal dengan program studi lain.', '#FFFFFF', '#3F3C3C', 'logo.png?1624943673', 0);
INSERT INTO `h_divisi` (`id_divisi`, `nama_divisi`, `logo`, `deskripsi`) VALUES
(10, 'Ketua &amp; Wakil Ketua', 'assets/img/divisi/1678338868.png', 'Ketua berperan mengoordinasikan seluruh kegiatan, menyusun rencana kegiatan, menyusun laporan pelaksanaan kegiatan, dan memimpin rapat. Wakil Ketua berperan membantu pelaksanaan tugas Ketua dan menjalankan peran Ketua saat Ketua berhalangan.'),
(11, 'Sekretaris', 'assets/img/divisi/1678338878.png', 'Sekretaris adalah anggota (pengurus) yang mengemban tugas tulis-menulis, atau surat-menyurat.'),
(12, 'Bendahara', 'assets/img/divisi/1678338888.png', 'Bendahara sebagai penanggung jawab (pemegang) atau pengurus keuangan.'),
(13, 'Divisi Riset dan Teknologi', 'assets/img/divisi/1678338900.png', 'Divisi yang berperan dalam memunculkan inovasi-inovasi dengan melakukan riset dan pengembangan.'),
(14, 'Divisi KOMINFO', 'assets/img/divisi/1678338910.png', 'Media dan Informasi adalah divisi yang bergerak dalam bidang multimedia dan berfungsi sebagai media penyebaran informasi di lingkup HMTI serta media sosial.'),
(15, 'Divisi Minat dan Bakat', 'assets/img/divisi/1678338921.png', 'Minat dan Bakat adalah divisi yang berfungsi sebagai wadah yang menaungi minat dan bakat para mahasiswa aktif Teknik Informatika Universitas Duta Bangsa, terutama di bidang teknologi.'),
(152, 'Divisi Humas', 'assets/img/divisi/1678338931.png', 'Divisi Hubungan Masyarakat , menjalankan tugas menyalurkan aspirasi dan sosialisasi di masyarakat');
