(1624000000, 'thumb-1624963579.jpg?1624964280', 'SIBARMATI #1 - Sinau CRUD Bareng', 1622291400, 'poster-1624963579.jpg?1624963838', '<p>Belajar bareng tentang CRUD memakai bahasa pemrograman PHP.</p>', 1, 'WIDI DWI NURCAHYO', 1631787134, 0, 0, 0, '', '', ''),
(1624963850, 'thumb-1624963850.jpg?1624964180', 'SIBARMATI #2 - Sinau Deployment Bareng', 1624798800, 'poster-1624963850.jpg?1624964180', '<p>Sinau bareng cara set up deploy website berbasis PHP secara otomatis memakai GITLAB CI</p>', 1, 'WIDI DWI NURCAHYO', 1631787157, 1, 0, 1, 'sertifikat-1624963850.jpeg?1631023720', '', ''),
(1624965855, 'thumb-1624965855.jpg?1624966103', 'WEBINAR ANDROID FUNDAMENTAL', 1693548000, 'poster-1624965855.jpg?1624965983', '<p>Kegiatan ini dilaksanakan oleh Divisi Minat dan\r\nBakat Himpunan Mahasiswa Prodi Teknik Informatika Fakultas Ilmu Komputer Universitas\r\nDuta Bangsa Surakarta, yang di ikuti oleh Mahasiswa Fakultas Ilmu Komputer\r\nUniversitas Duta Bangsa Surakarta dan umum, kuota perserta yaitu 450 orang dengan\r\npendaftar sejumlah mendaftar 339, konfirmasi 295 yang hadir<br></p>', 1, 'RIO SURYO LAKSONO', 1693547978, 0, 0, 0, '', '', ''),
(1631028424, 'thumbnail-img-1631028424.jpeg?1632006402', 'SIBARMATI #3 - Docker Fundamental', 1627748820, 'poster-img-1631028424.jpeg?1632006402', '<p>Sinau Bareng dasar-dasar membuat container di Docker bersama Arif Demawan.<br></p>', 1, 'WIDI DWI NURCAHYO', 1632006402, 0, 0, 1, '', '', ''),
(1631788051, 'thumbnail-img-1631788051.jpg?1632006428', 'SIBARMATI #4 - INTRODUCTION FOR GIT', 1630673100, 'poster-img-1631788051.jpg?1632006428', '<p>\r\n<a class=\"btn btn-success shadow\" target=\"_blank\" href=\"https://calendar.google.com/event?action=TEMPLATE&amp;tmeid=NDJibG1hZ2YyMHNvaWViOGE3dGZsM2t2cjAgd2lkaWJha2E1NUBt&amp;tmsrc=widibaka55%40gmail.com\">\r\n<i class=\"fa fa-calendar-alt mr-2\"></i> Tambah Ke <strong>Google Calendar</strong>\r\n</a>\r\n</p>\r\n\r\n<p>Belajar membuat repository di Git Version Control System bersama Yulidar Maulana</p>', 1, 'WIDI DWI NURCAHYO', 1632007788, 0, 0, 1, '', '', ''),
(1632658735, 'thumbnail-img-1632658735.png?1633347761', 'Webinar Cyber Security - Rekam Jejak Digital Tak Pernah Hilang', 1633748400, 'poster-img-1632658735.png?1633347761', '<p><b>WEBINAR CYBER SECURITY</b></p><p><b>Presented By</b></p><p>Himpunan Mahasiswa Prodi Teknik Infomatika</p><p><br></p><p>Hallo Sobat IT</p><p>Saat kita mengakses internet kita akan meninggalkan sebuah jejak yang biasa disebut dengan jejak digital. Nah, jejak digital ini dibagi menjadi 2 jenis, apa aja itu? Untuk mengetahuinya Ayo Hadiri kegiatan :</p><p><b><i>Webinar Cyber Security</i></b></p><p><b><i>\"Rekam Jejak Digital Tak Pernah Hilang\"</i></b></p><p><b><i><br></i></b></p><p><span style=\"font-size: 1rem;\">• Pembicara :</span><br></p><p>Dedy Hariyadi </p><p> VP of Technologi at Widya Security</p><p><br></p><p>•Moderator : </p><p>Rio Suryo Laksono</p><p> Pengurus HMPTI 2021</p><p>  </p><p>Acara akan dilaksanakan pada :</p><p>Hari/Tanggal : Sabtu, 09 Oktober 2021</p><p>Waktu : 09.00 s/d 11.00</p><p>Tempat : zoom meeting</p><p><br></p><p><span style=\"font-size: 1rem;\">• HTM : </span><br></p><p>Only 10k</p><p><br></p><p>• Benefit :</p><p>1. E-sertifikat</p><p>2. Doorprize</p><p><br></p><p>Alur Pendaftaran :</p><p>1. Melakukan pembayaran melalui</p><p>  - Link Aja : 082220499659 (a.n Pipin Yulanda)</p><p>  - Dana : 082220499659 (a.n Pipin Yulanda)</p><p>2. Mengisi formulir pendaftaran di s.id/Webinar_CyberSecurity</p><p>3. Konfirmasi pembayaran via WhatsApp cp</p><p><br></p><p>• CP : </p><p>081228852730 (Fitroh)</p><p>085641966948 (Risma)</p><p><br></p><p>Event ini terbuka untuk umum</p><p>Let\'s join !!</p>', 1, 'RIO SURYO LAKSONO', 1664860278, 0, 1, 1, 'sertifikat-1632658735.jpg?1634047331', 'No HP, Instansi', '<p class=\"MsoListParagraphCxSpFirst\" xss=\"removed\"><span xss=\"removed\">Terimakasih telah mendaftar.<o></o></span></p><p class=\"MsoListParagraphCxSpMiddle\" xss=\"removed\"><span xss=\"removed\">Silahkan gabung pada WA Grup berikut untuk\r\nupdate informasi selanjutnya :<