(1645334027, 'thumbnail-img-1645334027.png?1645782701', 'Webinar Cyber Security - Cyber Security Career Prospect', 1693548600, 'poster-img-1645334027.png?1645782701', '<p><span style=\"font-size: 1rem;\">Hallo Sobat IT...</span><br></p><p>Tahukah Anda, saat ini banyak peluang kerja di sektor Teknologi Informasi (TI). Khususnya, untuk bidang keamanan siber. Kebutuhan tenaga seorang spesialis Cyber Security sangat tinggi di era industri 4.0. Mau tau prospek pekerjaan seorang Cyber Security? Semua akan dikupas tuntas dalam.</p><p><br></p><p>Webinar Cyber Security</p><p>\"Cyber Security Career Prospect\"</p><p><br></p><p>Pembicara :</p><p>Wisnu Sanjaya</p><p>Lecturer and Digital Forensic Specialized</p><p><br></p><p>Moderator : </p><p>Rio Suryo Laksono</p><p><br></p><p>Acara akan dilaksanakan pada :</p><p>Hari/Tanggal : Sabtu, 12 Maret 2022</p><p>Waktu : 09.00 s/d 11.00</p><p>Tempat : zoom meeting</p><p><br></p><p>HTM : Only 10k</p><p><br></p><p>Benefit :</p><p>1. Relasi</p><p>2. E-sertifikat</p><p>3. Doorprize</p><p><br></p><p>Alur Pendaftaran :</p><p>1. Melakukan pembayaran melalui</p><p> - BCA :3930847134</p><p>- Dana : 081477089068</p><p>    a.n Tiara Indriyani</p><p>2. Mengisi formulir pendaftaran di :</p><p>http://s.id/webinar_cybersecurity</p><p>3. Konfirmasi pembayaran via WhatsApp CP</p><p><span style=\"font-size: 1rem;\"><br></span></p><p><span style=\"font-size: 1rem;\">CP : </span><br></p><p>0812 2985 4638 (Wihan)</p><p>0852 2802 6302 (Atik)</p><p>Event ini terbuka untuk umum</p><p>Let\'s join !!!</p>', 1, 'RIO SURYO LAKSONO', 1693548651, 0, 1, 1, 'sertifikat-1645334027.jpg?1647241841', '', '<p><span xss=\"removed\">Formulir pendaftran sudah terkirim. Silahkan masuk ke grub untuk informasi lebih lanjut.</span></p><p><a href=\"https://chat.whatsapp.com/LLJRVkWB9EX27i3QUCLJ7R\" target=\"_blank\">https://chat.whatsapp.com/LLJRVkWB9EX27i3QUCLJ7R</a></p>'),
