(1660966499, 'thumbnail-img-1660966499.png?1661340737', 'Sibarmati S2 #5 Linux System Administration (Ubuntu Server)', 1661932800, 'poster-img-1660966499.png?1661340737', '<p>\r\n\r\n\r\n	\r\n	\r\n	\r\n	\r\n\r\n</p><p style=\"line-height: 108%; margin-bottom: 0.11in\"><b>\r\nSibarmati #2 epsd 05 kali ini akan membahas mengenai <font face=\"Times New Roman, serif\" style=\"\"><font style=\"font-size: 12pt\" size=\"3\">Linux\r\nSystem Administration (Ubuntu Server)</font></font></b></p><p style=\"line-height: 108%; margin-bottom: 0.11in\"><br></p><p style=\"line-height: 108%; margin-bottom: 0.11in\">Sebelum mengikuti acara sibarmati ini peserta diharapkan untuk mendownload software dan iso terlebih dahulu, link download sebagai berikut:</p><p style=\"line-height: 108%; margin-bottom: 0.11in\">\r\n\r\n\r\n	\r\n	\r\n	\r\n	\r\n\r\n</p><p style=\"line-height: 100%; margin-bottom: 0in\">\r\nVirtual Box</p>\r\n<p style=\"line-height: 100%; margin-bottom: 0in\">Link :</p><p style=\"line-height: 100%; margin-bottom: 0in\"><a href=\"https://www.virtualbox.org/wiki/Downloads\">https://www.virtualbox.org/wiki/Downloads</a></p>\r\n<p style=\"line-height: 100%; margin-bottom: 0in\">atau</p>\r\n<p style=\"line-height: 100%; margin-bottom: 0in\"><a href=\"https://download.virtualbox.org/virtualbox/6.1.36/VirtualBox-6.1.36-152435-Win.exe\">https://download.virtualbox.org/virtualbox/6.1.36/VirtualBox-6.1.36-152435-Win.exe</a></p>\r\n<p style=\"line-height: 100%; margin-bottom: 0in\"><br>\r\n\r\n</p>\r\n<p style=\"line-height: 100%; margin-bottom: 0in\">Ubuntu Server</p>\r\n<p style=\"line-height: 100%; margin-bottom: 0in\">Link :\r\n</p><p style=\"line-height: 100%; margin-bottom: 0in\"><span style=\"background-color: transparent; font-size: 1rem;\">https://cdimage.ubuntu.com/releases/18.04/release/</span><br></p>\r\n<p style=\"line-height: 100%; margin-bottom: 0in\">atau</p>\r\n<p style=\"line-height: 100%; margin-bottom: 0in\"><a href=\"https://cdimage.ubuntu.com/releases/18.04/release/ubuntu-18.04.6-server-amd64.iso\">https://cdimage.ubuntu.com/releases/18.04/release/ubuntu-18.04.6-server-amd64.iso</a></p>\r\n<p style=\"line-height: 100%; margin-bottom: 0in\"><br>\r\n\r\n</p>\r\n\r\n<p style=\"line-height: 108%; margin-bottom: 0.11in\"><style type=\"text/css\">p { line-height: 115%; margin-bottom: 0.1in; background: transparent }a:link { color: #000080; so-language: zxx; text-decoration: underline }</style><br><br></p><p style=\"line-height: 100%; margin-bottom: 0in\"><style type=\"text/css\">p { line-height: 115%; text-align: left; orphans: 2; widows: 2; margin-bottom: 0.1in; direction: ltr; background: transparent }</style></p>\r\n\r\n<p><style type=\"text/css\">p { line-height: 115%; margin-bottom: 0.1in; background: transparent }a:link { color: #000080; so-language: zxx; text-decoration: underline }</style></p>', 1, 'FANDI AZIZ PRATAMA', 1661342088, 0, 0, 1, '', 'Email, No Whatsapp', '<p>\r\n\r\n \r\n \r\n \r\n \r\n\r\n\r\nTerimakasih sudah mendaftar, silahkan join grup whatsapp kami\r\ndi <a href=\"https://chat.whatsapp.com/JCvhkoxdXAI9mhYivX0lJP\" target=\"_blank\">chat.whatsapp.com</a></p>'),
(1662880934, 'thumbnail-img-1662880934.jpeg?1662881440', 'PRE ORDER PEMBUATAN JAKET', 1665507540, 'poster-img-1662880934.jpeg?1662881440', '<p>Assalamu\'alaikum wr.wb.</p><p>Haii bestyyy, apa kabar semua? Ada yang baru nihh buat kita anak IT????</p><p><br></p><p>Kami Himpunan Mahasiswa Program Studi Teknik Informatika UDB mengadakan PRE ORDER PEMBUATAN JAKET \"Code Igniter\"</p><p><br></p><p><b>System : Pre Order </b></p><p><b>Price : Rp. 160.000 (No DP)</b></p><p><b>Gotten : Jaket  </b></p><p><b>Ingredient : Taslan</b></p><p><b>Warna : Hitam</b></p><p><b>Registration Time : 12-23 September 2022 </b></p><p><br></p><p> Pembayaran Online :</p><p><b> Mandiri : 1380020621996</b></p><p>a/n Rio Suryo Laksono </p><p><br></p><p>Link Pendaftaran & konfirmasi pembayaran : </p><p><br></p><p>*Pembayaran Offline Hubungi </p><p>CP: </p><p>0851-5681-5391</p><p>an Ikhsan </p><p><br></p><p>Note‼️</p><p>*Penulisan nama & ukuran harus tepat</p><p><br></p><p>Catat tanggalnya yaaa</p><p>12-23 September 2022</p><p><br></p><p>Wassalamualaikum wr.wb.</p>', 1, 'JOFAN FATHURAHMAN 2020', 1663940745, 0, 1, 0, '', 'Nama,Asal instansi,Ukuran,Isi alamat lengkap jika diluar Kota Solo/isi', '<p>Pesanan anda sudah kami terima, untuk infomasi lebih lanjut silahkan bergabung digrub ini yaa!</p><p><a href=\"https://chat.whatsapp.com/I4OoXraR7bvJ0B7Zjlt2n2\" target=\"_blank\">https://chat.whatsapp.com/I4OoXraR7bvJ0B7Zjlt2n2</a></p><p>Terimakasih<br><br></p>'),
(1663913369, 'thumbnail-img-1663913369.jpg?1664155338', 'SIBARMATI SEASON 2 EPISODE 6', 1665717000, 'poster-img-1663913369.jpg?1664155338', '<p>Hallo sobat IT,</p><p>Kami punya info menarik buat kalian, Himpunan Mahasiswa Prodi Teknik informatika UDB Surakarta akan kembali menghadirkan acara Sinau Bareng Mahasiswa Teknik Informatika atau Sibarmati season 2 part 6 dengan acara yang paling memuaskan. Karena :</p><p>Tema : </p><p><br></p><p>✨Belajar PHP bersama anak HMPTI, mencari dan menciptakan bibit unggul✨</p><p><br></p><p>judul :</p><p><br></p><p>✨Studi Kasus Sistem Pengolahaan data Mahasiswa✨</p><p><br></p><p>Dan pada kesempatan kali ini kita akan belajar bersama Kakak *_Jofan Fathurahman_* (Anggota dari divisi Riset dan Teknologi HMPTI ).</p><p><br></p><p>Eitsss.. tapi ada yang beda dari Sibarmati kali ini dengan sebelumnya. Dikesempatan kali ini kita akan mengadakan Sibarmati secara offline. Wahh jadi tambah menarik bukan? Kapan lagi bisa nongkrong sekaligus sinau bareng dengan ilmu yang sangat bermanfaat tentunya.</p><p><br></p><p>Acara ini akan dilaksanakan pada</p><p>????Hari, Tanggal : Sabtu, 01 Oktober 2022</p><p>⏰Waktu : Pukul 09.30 wib - Selesai</p><p>????Tempat : Aula 2 (*OFFLINE*)</p><p><br></p><p>Tunggu apalagi ? let\'s join with us!!</p><p>Kuota Terbatas!</p><p><br></p><p>????Link pendaftaran</p><p>https://s.id/SibarmatiSeason2Epsd6</p><p><br></p><p>????Contacts Person</p><p>Rama : 0899-5226-718</p><p>Saputra  : 0858‑7611‑4144  </p><p><br></p><p><br></p><p>Salam sobat IT,</p><p>Terimakasih.</p>', 1, 'JOFAN FATHURAHMAN 2020', 1665535596, 50, 0, 1, '', 'Nama, Email, Nomor WhatsApp', 'Untuk bergabung dengan WhatsApp grup silahkan klik link berikut :https://chat.whatsapp.com/JCvhkoxdXAI9mhYivX0lJP'),
