(1683178917, 'thumbnail-img-1683178917.jpg?1686021042', 'Webinar Nasional AI for Web Programming', 1693544700, 'poster-img-1683178917.jpg?1686021042', '<p>[WEBINAR NASIONAL PROGRAMMING : BUILDING INTERFACE FOR WEBSITE WITH AI PROGAMMING]</p><p><br></p><p>Halo temen-temen semua????????, apa kabar nih kalian? Semoga selalu sehat yaa. ????????</p><p><br></p><p>Nah pada kesempatan kali ini, Himpunan Mahasiswa Teknik Informatika Universitas Duta Bangsa Surakarta (HMPTI UDB) akan mengadakan Webinar Nasional terkait tentang Programming/Pemrograman nihh. </p><p><br></p><p>Webinar Nasional kali ini merujuk pada Pembangunan interface website dengan algoritma ai programming dan Implementasi  untuk aplikasi website interface.</p><p><br></p><p>Nah menarik kan, Untuk mau belajar?????</p><p><br></p><p>Yuk cari tau, dengan mengikuti Webinar Nasional Programming yang berjudul tentang : </p><p><br></p><p>-<span style=\"white-space:pre\">	</span>Building Interface for Website with AI Programming.</p><p><br></p><p>Dengan narasumber hebat dan sangat berpengalaman kita yaitu:</p><p><br></p><p>✨ Muhammad Afifuddin Basyaiban, S.Kom (Master of Wahidev Academy Indonesia)✨</p><p><br></p><p><br></p>', 1, 'RIO SURYO LAKSONO', 1693548410, 0, 1, 1, 'sertifikat-1683178917.jpeg?1691994374', 'Provinsi,Nama Instansi', '<p>Terimakasih bagi teman-teman yang telah mendaftar  jangan lupa untuk join grup WhatsApp untuk info lebih lanjut#</p><p><a href=\"https://chat.whatsapp.com/JL8y3DdHfjIA9Gp59mK2lV\" target=\"_blank\">chat.whatsapp.com</a>#</p><p><br></p><p>Harap konfirmasi pembayaran ke nomor CP yang ada di bawah ini :</p><p>WhatsApp</p><p>08995226718 (Rama)</p><p>089662606800 (Hafidh)</p>'),
